/* sysuser-->sys_user */
DELETE FROM aws.sysuser where name = 'admin';
UPDATE sys_user SET id = LOWER(REPLACE(id,'-',''));

/* country */
UPDATE country SET id = LOWER(REPLACE(id,'-',''));
UPDATE country JOIN sys_user ON country.create_by = sys_user.login_name SET country.create_by = sys_user.id;
UPDATE country JOIN sys_user ON country.update_by = sys_user.login_name SET country.update_by = sys_user.id;

/* city */
UPDATE city SET id = LOWER(REPLACE(id,'-','')), country = LOWER(REPLACE(country,'-',''));
UPDATE city JOIN sys_user ON city.create_by = sys_user.login_name set city.create_by = sys_user.id;
UPDATE city JOIN sys_user ON city.update_by = sys_user.login_name set city.update_by = sys_user.id;

